def get_stock_data():
    """获取所有股票数据字典"""
    return STOCK_NAME_DATA.get('stocks', {})


def get_stock_name_mapping():
    """获取股票名称到代码的映射"""
    # 如果JSON中已有映射，直接返回
    if 'name_to_code' in STOCK_NAME_DATA:
        return STOCK_NAME_DATA['name_to_code']
    
    # 否则动态生成
    stocks = STOCK_NAME_DATA.get('stocks', {})
    name_to_code = {}
    for code, info in stocks.items():
        name = info.get('name', '')
        if name:
            name_to_code[name] = code
    return name_to_code


def get_stock_info(code):
    """根据股票代码获取股票信息"""
    stocks = STOCK_NAME_DATA.get('stocks', {})
    return stocks.get(code, None)


def get_code_by_name(name):
    """根据股票名称获取代码"""
    name_mapping = get_stock_name_mapping()
    return name_mapping.get(name, None)


def get_total_count():
    """获取股票总数"""
    return STOCK_NAME_DATA.get('total_count', len(STOCK_NAME_DATA.get('stocks', {})))
